design/publisher.html.body:
Javascript设计模式 - 观察者模式
观察者模式又叫发布—订阅模式，它定义对象间的一种一对多的依赖关系，当一个对象的状态发生改变时，所有依赖于它的对象都将得到通知。
class Publisher {
    constructor() {
        this.clientList = {};
    }
    listen(key, fn) {
        this.clientList[key] = fn;
    }
    trigger(key, price) {
        let fns = this.clientList[key];
        if ( !fns ) {
            return false;
        }
        fns( price );
    }
    remove(key, fn) {
        delete this.clientList[key];
    }
}

